import './ExerciseList.scss';
import Exercise from './Exercise';
import { useEffect, useState } from 'react';

function ExerciseList() {

  const [list, setList] = useState([]);
  useEffect(()=>{
    fetch('http://localhost:3000/workouts')
      .then(response => response.json())
      .then(setList);
  }, []);

  return (
    <div className="ExerciseList">
            <table>
        <thead>
          <tr>
            <th>Id</th>
            <th>Name</th>
            <th>Type</th>
            <th>Timing</th>
            <th>Target Area</th>
          </tr>
        </thead>
        <tbody>
          { 
          list.map(item =>
            <Exercise 
              key={ item.id }
              id={ item.id } 
              name={ item.name } 
              type={ item.type } 
              timing={ item.timing } 
              target={ item.target } 
            />
          ) }
        </tbody>
        </table>

        <button>Add Exercise</button>

        <br />
        <br />

        <form>
          <input type="text" id="fname" name="fname" value="Id" /> 
          &nbsp;&nbsp;
          <input type="text" id="lname" name="lname" value="Name" />
          &nbsp;&nbsp;          
          <input type="text" id="lname" name="lname" value="Type" />
          &nbsp;&nbsp;         
          <input type="text" id="lname" name="lname" value="Timing" />
          &nbsp;&nbsp;
          <input type="text" id="lname" name="lname" value="Target" />
          &nbsp;&nbsp;
          <br />
          <br />
          <input type="submit" value="Submit" />
        </form> 

    </div>
  );
}

export default ExerciseList;
